<template>
  <q-layout
      view="lHh Lpr lFf"
  >
    <q-page-container>
      <FLoadingScreen v-if="AppIsLoading"/>
      <AppPage v-else />
    </q-page-container>
  </q-layout>
</template>

<script lang="ts" setup>
  import type {IUIActions} from "@/classes/UI/Interfaces/IUIActions";
  import {useQuasar} from "quasar";
  import {computed, inject, onMounted, watch} from "vue";
  import {storeToRefs} from "pinia";
  import {UIStore} from "@/classes/Pinia/UIStore/UIStore";
  import FLoadingScreen from "@/components/common/FLoadingScreen.vue";
  import type {TranslateFunction} from "@/lang/TranslateFunction";
  import {useI18n} from "vue-i18n";
  import AppPage from "@/components/AppPage.vue";
  import {useRouter} from "vue-router";
  /* @ts-ignore */
  import Hammer from 'hammerjs';
  import { interval, Subject, throttle} from "rxjs";

  const $q = useQuasar();
  $q.dark.set('auto');
  const router = useRouter();
  const UI = inject<IUIActions>('UI');

  const {t} = useI18n() as {t:TranslateFunction};

  const {
      isReady,
      launchError,
      userQueryError,
      user,
      isLoading,
  } = storeToRefs(UIStore())

  const AppIsLoading = computed(() => {
    return !isReady.value;
  });

  watch(isLoading, (neoVal) => {
    if(neoVal){
      $q.loading.show({
        delay: 1000
      });
    }
    else{
      $q.loading.hide();
    }
  });

  watch((launchError), (neoVal) => {
    if(neoVal){
      $q.dialog({
        title: t('Launch.error'),
        message: t('Launch.errorLaunch'),
        html: true,
        persistent: true,
        ok: false
      });
    }
  });
  watch((userQueryError), (neoVal) => {
    if(neoVal){
      $q.dialog({
        title: t('Launch.error'),
        message: t('Launch.errorGetUser'),
        html: true,
        persistent: true,
        ok: false
      });
    }
  });

  watch(isReady, (neoVal) => {
    if(neoVal){
      if(user.value.isNew){
        UI?.showWelcomeSlides({
          /*TODO: СДЕЛАТЬ КРАСИВЫЕ СЛАЙДЫ И ОПИСАТЬ ЧТО ДЕЛАТЬ! https://dev.vk.com/ru/mini-apps/development/information-screens
                  Вынести эти слайды в json файлы, подгружать ассинхронно и вынести в отдельную функцию что ли. В окне настроек дать возможность посмотреть инструкцию еще раз...
          * */
          slides: [
            {
              media: {
                blob: 'data:image/jpeg;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.1.title'),
              subtitle: t('Launch.welcomeSlides.1.subtitle'),
            },
            {
              media: {
                blob: 'data:image/jpeg;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.2.title'),
              subtitle: t('Launch.welcomeSlides.2.subtitle'),
            },
            {
              media: {
                blob: 'data:image/jpeg;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.3.title'),
              subtitle: t('Launch.welcomeSlides.3.subtitle'),
            },
          ]
        })
      }
    }
  });

  onMounted(() => {
      if(launchError.value){
        $q.dialog({
          title: t('Launch.error'),
          message: t('Launch.errorLaunch'),
          html: true,
          persistent: true,
          ok: false
        });
      }
      if(userQueryError.value){
        $q.dialog({
          title: t('Launch.error'),
          message: t('Launch.errorGetUser'),
          html: true,
          persistent: true,
          ok: false
        });
      }

      const navigateSubject = new Subject();
        navigateSubject.pipe(
            throttle(() => interval(1000))
        ).subscribe((value) => {
          doNavigate(value as number);
        });
      const body = document.querySelector('body');
      const mc = new Hammer(body);
      mc.get('pan').set({direction: Hammer.DIRECTION_HORIZONTAL});
      mc.on('panleft panright', (swipeEvent:any) => {
        const target = swipeEvent.target;
        if(target && target.closest('.swiper')){
          return;
        }
        if(swipeEvent.distance > 80){
          if(swipeEvent.additionalEvent == 'panleft'){
            navigateSubject.next(1);
          }
          if(swipeEvent.additionalEvent == 'panright'){
            navigateSubject.next(-1);
          }

        }

      });
  });

  const doNavigate = (delta: number) => {
    //console.log('>>> delta ', delta);
    router.go(delta);
  }

</script>
